INSERT INTO `etec_pages` (`idPages`, `tituloPages`, `codPages`, `conteudoPages`) VALUES
(49, 'HistÃ³ria', 'HIS', 'Nossa Missão\r\nOferecer ensino de qualidade, visando a formação integral, ética, empreendedora, com responsabilidade social e ao meio ambiente.\r\n\r\nNossa Visão\r\nSer referência na educação básica e profissional, buscando aprimoramento contínuo e inovando sempre.\r\n\r\nNossa História\r\nA Escola Técnica Estadual Centro Paula Souza Unidade Lins , teve como finalidade de implantação gerar mão de obra qualificada e especializada para atender o mercado regional (Lins, Guaiçara, Getulina, Sabino, Promissão, Avanhandava, Penápolis, Barbosa, Alto Alegre, José Bonifácio, Ubarana, Cafelândia, Guarantã, Guaimbê, Júlio Mesquita, Uru e Pongaí), compreendendo uma população em torno de 300 mil habitantes. Com a publicação da Secretaria da Educação que não manteria mais os cursos Técnicos vinculados àquela Secretaria, pois o mesmo não fazia parte dos objetivos a ela atribuídos, sentiu-se a necessidade de atender os anseios da população que clamava pela oportunidade do ensino gratuito e de qualidade. No ano de 1998, mais precisamente no mês de agosto, foi implantado como Classe Descentralizada da ETEC Profª Helcy Moreira Martins Aguiar, do município de Cafelândia com convênio Centro Paula Souza e Secretaria da Educação e iniciaram-se duas turmas do Curso Técnico em Administração, sendo uma diurna e outra noturna, funcionando em salas emprestadas pela escola EE Fernando Costa na cidade de Lins.\r\nA ideia original seria de que todos os cursos técnicos mantidos pela escola EE Fernando Costa seriam passados para o Centro Paula Souza, desde que atendesse a demanda e houvesse laboratórios compatíveis para sua manutenção. No primeiro semestre de 1999, iniciou-se uma turma do Curso Técnico em Edificações e outra do Técnico em Enfermagem, os quais permanecem até a presente data. Havia um acerto prévio de que no 2º semestre de 1999, os Cursos Técnicos em Mecânica, Eletrotécnica e Eletrônica, viessem também a integrar os cursos oferecidos pelo Centro Paula Souza em Lins; porém, por motivos alheios ao nosso conhecimento, os professores dos referidos cursos optaram por permanecer vinculados à Secretaria da Educação, embora, sabendo que futuramente seriam extintos. Como não ocorreu tal transferência de cursos, o Centro Paula Souza passou a oferecer o Curso de Qualificação de Auxiliar de Enfermagem, com duração de um ano. Já em 2000, nossa escola oferecia diversos cursos a saber:\r\n\r\n- 2 turmas de Técnico em Edificações;\r\n- 2 turmas de Auxiliar de Enfermagem;\r\n- 1 turma de Técnico em Enfermagem;\r\n- 3 turmas de Administração.\r\n\r\nObservação: O Curso de Auxiliar de Enfermagem foi criado objetivando atender os profissionais que já atuavam, porém, não dispunham de certificação, o que passava a ser exigido legalmente a partir daquele momento. Já em 2003, o Centro Paula Souza de Lins, mantinha:\r\n\r\n- 3 turmas de Técnico em Edificações;\r\n- 3 turmas de Técnico em Enfermagem;\r\n- 3 turmas de Técnico em Administração.\r\n\r\nTotalizando cerca de 360 alunos, sempre visando a melhoria da qualificação profissional, de modo a oferecer profissionais cada vez mais capacitados para enfrentar o concorrido mercado de trabalho. No 1º semestre de 2004, atendendo a necessidade de qualificação de profissionais de seus colaboradores, através de convênio com o Grupo Bertin implantou-se mais um curso o Técnico em Processamento de Carnes, o que totaliza cerca de 400 alunos. Através do Decreto Estadual nº 46.960, de 29 de julho de 2002, publicado no DOE de 30/07/2002, na sua ementa, assim menciona: "Autoriza a Fazenda do Estado a permitir o uso, a título precário, em favor do Centro Estadual de Educação Tecnológica Paula Souza ? CEETEPS, de parte de imóvel que especifica, situada no município de Lins", parte de imóvel onde funciona a EE Fernando Costa, visando a implantação e manutenção de educação profissional técnica de nível médio. A Escola teve sua autorização de funcionamento publicada em 16 de junho de 2006 e passou a funcionar em prédio próprio, reformado e adaptado às necessidades da Unidade Escolar, passando a se chamar Escola Técnica Estadual de Lins - ETEC de Lins. A partir do 1º semestre de 2007, o curso Técnico em Informática passou a ser oferecido na U.E., no período da tarde. O Ensino Médio teve seu início no 1º semestre de 2008. Já no 2º semestre do mesmo ano, houve a implantação do Curso Técnico em Química.\r\n\r\nO Curso Pós-Técnico em Empreendedorismo foi conquistado pela ETEC em maio de 2009 e formou, em outubro de 2009, sua primeira turma. Desde o dia 17 de agosto de 2009, a ETEC oferece também os cursos de Técnico em Informática para Internet, Comércio, Serviços Jurídicos e Marketing, fazendo parte do Programa de Expansão II do Governo do Estado de São Paulo, nas instalações da E.E. Fernando Costa. Em parceria firmada entre a Secretaria de Estado da Educação e Centro Paula Souza, a partir de 2012, a Etec faz parte do programa REDE, com o ETIM - Ensino Técnico Integrado ao Ensino Médio, sendo que a Unidade Escolar passou a disponibilizar o Curso de Técnico em Informática para Internet Integrado ao Ensino Médio, onde os Componentes Curriculares da Base Comum são de responsabilidade da EE Fernando Costa e a parte Técnica da Etec de Lins. Para o 2º Semestre do mesmo ano, a U. E. passou a oferecer o Curso Técnico em Finanças, no 1º semestre de 2013 o Técnico em Secretariado e no 2º semestre do referido ano o Técnico em Manutenção e Suporte em Informática no período da tarde.\r\n\r\nA ETEC é reconhecida pela comunidade como uma excelente escola, tanto pela qualidade de ensino como pelas oportunidades de estágios e empregos que sua exemplar relação com as mais diversas empresas e com o setor Público oferece a seus alunos. Parcerias e convênios que viabilizam essas práticas são mantidas com extrema afinação entre as partes. Hoje a ETEC oferece, também, Cursos Técnicos em parceria com outros Municípios através de convênios, dentre eles: o curso de Técnico em Segurança do Trabalho, na cidade de Guaiçara e Técnico em Serviços Jurídicos em Sabino. No ano de 2014 a Etec de Lins proporcionou a comunidade de Lins e Região o Ensino Médio Integrado ao Técnico em Informática do Centro Paula Souza.'),
(51, 'APM', 'APM', 'Associação de Pais e Mestres da Etec de Lins:\r\nI - Diretor Executivo: Rosângela Badine Pizzighini\r\nII - Vice-Diretor Executivo: Silvia Mara Frare Rodrigues\r\nIII - Secretário: Terezinha Boa Sorte\r\nIV - Diretor Financeiro: Elane Teixeira Nascimento\r\nV - Vice-Diretor Financeiro: Liliana Silva Versalli Moreira Pereira\r\nVI - Diretor Cultural: Flavia Tramujas Siviero\r\nVII - Diretor de Esportes: Sidneia Alves da Silva\r\nVIII - Diretor Social: Maria Luiza Bastos dos Santos\r\nIX - Diretor de Patrimônio: Livia Maria Gava França\r\n\r\nA APM estará prosseguindo com o trabalho iniciado pela gestão anteri-or, tendo um foco novo nas parcerias com empresas e, principalmente, com instituições de ensino. Dentro desse novo projeto já firmou-se parcerias com o Unisalesiano (Lins) a Univem (Marília), Unilins (Lins) e Unimep (Lins), com a finalidade de proporcionar aos alunos concluintes e contri-buintes da APM dos cursos técnicos da ETEC de Lins descontos nas mensali-dades da Faculdade escolhida pela aluno. Esse desconto o acompanhará até o final da graduação, sendo mais um estímulo e auxílio para que consiga alcançar a formação superior.\r\n\r\nA grande bandeira que empunhamos é a da promoção humana, do acesso facilitado ao ensino superior e da melhoria da qualidade de vida dos nos-sos alunos, através de Educação de qualidade.\r\n\r\nOutras parcerias serão firmadas no decorrer da gestão e, ao passo que isso for acontecendo, os alunos serão comunicados. Sempre em frente, com força e coragem, podemos mudar os rumos da história.');
