INSERT INTO `lions_hotels` (`idHotels`, `nameHotels`, `addressHotels`, `emailHotels`, `phoneHotels`, `detailsHotels`, `imageHotels`) VALUES
(5, 'WANNA HOTEL', 'Rua Vitoriano Borges, 117 ? centro ? Lins -SP', '', '(14) 3523-1317 (14) 3632-5852 (14) 9-9711-4321 ', 'Apartamento Single 			(01 cama de casal) <br/>R$80,00	(ala antiga)<br/>R$ 90,00	(ala nova)<br/><br/>Apartamento Duplo 			(02 camas de solteiro)<br/>R$130,00	   (ala antiga)<br/>R$ 135,00   (ala nova)<br/><br/>Apartamento triplo			(01 cama de casal e 01 cama de solteiro)<br/>R$170,00<br/><br/>Cortesias: Estacionamento, Wi-fi, TV a cabo, ar condicionado, frigobar abastecido, Café da manhã. Não cobra taxa de serviço.<br/>', '15552823145cb3b98a1747b.jpeg'),
(6, 'CRISTAL PALACE HOTEL ', 'Rua Luiz Gama, 1771 | Lins -SP', '', '(14) 3511-0700 ', 'Apartamento Single 		R$ 145,00 <br/>Apartamento Casal/Duplo 	R$ 165,00<br/>Apartamento triplo		R$ 185,00<br/>Suíte Master			R$ 280,00 <br/>Cortesias: Estacionamento, Wi-fi, TV a cabo, ar condicionado, frigobar abastecido, Café da manhã. Não cobra taxa de serviço.<br/><br/>www.cristalpalace.com.br ', '15552823455cb3b9a9e86b9.jpeg'),
(7, 'HOTEL CENTRAL', 'Rua Floriano Peixoto, 657 - Lins - SP', '', '(14) 9-8229-9888 (14) 3532-8500 ', 'Apartamento Casal 		R$ 150,00<br/>Apartamento Solteiro		R$ 100,00<br/>As diárias inclui estacionamento, internet, ar condicionado, frigobar e café da manhã. Todos os apartamentos recém reformados.<br/>', NULL),
(8, 'HOTEL RIVIERA', 'Rua São Vito, 05 - Labate ? Lins -SP', 'gerencialins@hotelriviera.com.br', '(14) 3522-5766', 'Apartamento Duplo 		R$ 130,00<br/>Apartamento triplo		R$ 165,00<br/>Apartamento Individual	R$  95,00 <br/>Cortesias: Estacionamento, Wi-fi, internet, TV a cabo, ar condicionado, frigobar abastecido, Café da manhã. Não cobra taxa de serviço.<br/>', '15552823725cb3b9c4d9614.jpeg'),
(9, 'HOTEL IBIS - LINS', 'Rua Floriano Peixoto, 1808 - centro ? Lins -SP', 'financeiro.lins@agisol.com.br', '(14) 3511-0100', 'Hospedagem		R$ 149,00 + 2% ISS = R$ 151,98  - por apartamento<br/><br/>Obs:- todos os apartamentos são o mesmo valor. O que diferencia os mesmos são as configurações da cama. Há apartamentos com 01 cama de casal; com 02 camas de solteiro e com 01 cama de casal + 01 mini cama para uma criança até 11 anos.<br/>Apartamento triplo		R$ 165,00<br/>Apartamento Individual	R$  95,00 <br/>Cortesias: Estacionamento, Wi-fi, internet, TV a cabo, café da manhã. Não cobra taxa de serviço.<br/>*Todos os valores acima já estão inclusos: café da manhã, garagem e internet sem taxas.<br/>Horário de check-in: a partir de 12:00 hs, horário de check-out: até 12:00 hs. <br/>Toda reserva com check-in após as 18:00hs tem que conter a garantia do cartão de crédito (número, data de validade e código de segurança ou depósito bancário). <br/>Caso a reserva não realizar o check-in, os dados do cartão será usado no valor de 01 diária correspondente ao número de pessoas. <br/>Toda reserva sem essa garantia, após o horário limite é automaticamente cancelada, retornando à disposição de uma outra locação na fila de espera ou no balcão.<br/>', '15552823945cb3b9da666dc.jpeg'),
(10, 'BLUE TREE HOTEIS', '', 'grupos.lins@bluetree.com.br', '(14) 3533-6300 ', '', '15552824175cb3b9f19e81d.jpeg'),
(12, 'Hotel Barravento', 'R. Ver. Manoel Ouvinhas Júnior, 31 - Jardim Arapua, Lins - SP, 16400-480', '', '(14) 3522-5050 3523-8777 3523-8778', 'Quarto Simples R$ 85,00<br/>Duplo R$ 140,00<br/>Triplo R$ 175,00<br/>Quadruplo R$ 220,00<br/>Quintoplo R$ 275,00', '15560487505cbf6b6e57c5c.png');
INSERT INTO `lions_information` (`idInformation`, `dateInformation`, `titleInformation`, `bodyInformation`, `imageInformation`) VALUES
(11, '2019-02-16', 'Clube Linense 20 Anos Depois', 'As dependências do tradicional Clube Linense serão a Sede da 20ª Convenção do Distrito LC8 em 4 e 5 de maio de 2019. Após uma ampla e completa reforma do espaço físico, o Clube Linense totalmente remodelado volta a sediar nosso distrito apos 20 anos, quando tivemos a última convenção do Distrito L19, com o então jovem governador Manoel Messias Melo. O Lions Clube de Lins estará completando 60 anos e a Governadora Marinha e o PDG Jair esperam a sua presença no nosso grande encontro anual. Aguarde novas informações para breve!', '15552485185cb33586228f7.jpeg'),
(12, '2019-02-16', 'Pin da Convenção', 'Agora você já conhece a logo da 20ª Convenção do Distrito LC8. Este belíssimo trabalho é mais uma criação profissional do nosso querido e genial CL Cabelo, do Lions Clube Bauru Bela Vista.<br/>Você não pode perder a oportunidade de usar este fantástico pin e guarda-lo em sua coleção .<br/>Até maio!', '15552486105cb335e27d625.png');
