INSERT INTO `lions_timeline` (`idTimeline`, `imgTimeline`, `descriptionTimeline`, `idUser`) VALUES
(9, '15555522355cb7d7eb04d8e.jpg', 'Equipe do Lions Clube de Lins reunida no salão do Clube Linense, local da 20a Convenção do Distrito LC8. <br/>Preparação a todo vapor! Esperamos vocês!', 6),
(8, '15554647365cb68220b0fd8.jpeg', 'Este é o espaço pra voce enviar uma Foto Ilustrativa e o seu recado pra todos os CCLL do LC8. Apenas posts sobre Lions e a Convenção... outros assuntos não devem ser postados aqui.<br/>Vamos nos comunicar, participe do Instagran da Convenção!', 6),
(11, '15558721145cbcb9727be69.jpeg', 'Sessão Nostalgia 1 - Há 20 anos<br/>Convenção do L19 - Café da manhã<br/>CL Flavio / DG Messias / PIP Soliva / CL Netinho', 6),
(12, '15558722565cbcba0016400.jpeg', 'Sessão Nostalgia 2 - Há 20 anos<br/>Convenção do L19 - Salão do Clube Linense - Record de Inscrições', 6),
(13, '15558723525cbcba607fff9.jpeg', 'Sessão Nostalgia 3 - Há 20 anos<br/>Convenção do L19 - Mesa Diretora, PIP Soliva Orador Oficial.', 6),
(14, '15558725185cbcbb06d1f88.jpeg', 'Sessão Nostalgia 4 - Há 20 anos<br/>Convenção do L19  - Casal Governador Messias e Sandra.', 6),
