(24, '15562401485cc25714a270c.jpeg', 'Se eu fosse voce, eu não perderia a Abertura da 20a Convenção LC8 no Sábado, quando vamos tambem celebrar em grande estilo os 60 anos do Lions Clube de Lins. Vem conosco!', 6),
