(114, '2019-06-25', 'B', 6, 14, 14, 'Necessário verificar uma tecnologia que reduza o valor do investimento pelo cliente.\r\nA tecnologia pode ser comercializada tanto para empresas como para o setor público.\r\nImportante fazer o laboratório e teste do produto.'),
