(119, '2019-06-25', 'B', 7, 14, 15, ''),
(120, '2019-06-25', 'B', 7, 14, 16, 'O projeto tem apelo comercial e alinhado com o momento atual de incorporar e intensificar o uso intensivo de tecnologia e automação (IoT). Necessário mensurar o valor do investimento para uma residência, definir o público alvo e canais de vendas e comunicação. Ou seja elaborar o modelo de negócio e validar o produto no mercado.'),
(121, '2019-06-25', 'B', 8, 14, 18, ''),
(122, '2019-06-25', 'B', 8, 14, 19, ''),
(123, '2019-06-25', 'B', 8, 14, 21, 'O projeto embora tenha sido desenvolvido para resolver um problema da propriedade rural da escola poderá ser aplicado no mercado.\r\nPara tanto é importante o laboratório e acompanhamento dos indicadores para enriquecer a proposta. Necessário também conhecer tecnologias existentes e que poderá auxiliar na maturação do projeto.'),
(124, '2019-06-25', 'B', 9, 14, 22, ''),
(125, '2019-06-25', 'B', 9, 14, 23, 'A proposta é interessante e de baixa complexidade.\r\nPode ser aplicada ao mercado mas necessita fazer um laboratório e testar o produto. \r\nAlém do aspecto de controle existe também a questão da segurança e identificação dos passageiros no caso de um acidente. Penso que esse aspecto poderá agregar valor ao projeto. Necessário pesquisar as tecnologias existentes no setor de transportes que tenham foco para a segurança do usuário.'),
(126, '2019-06-25', 'R', 8, 1, 18, 'Aluna não apresentou segurança na apresentação, bem como falta de domínio do conteúdo.'),
