INSERT INTO `work_project` (`idProject`, `nameProject`, `resumeProject`) VALUES
(3, 'Desenvolvimento de um repositório web para Etec Cafelândia', 'O foco deste projeto é aprimorar o armazenamento e acesso aos trabalhos de conclusão de curso da Etec Cafelândia.'),
(4, 'Desenvolvimento de um website voltado para o controle de agendamento de recursos e laboratórios da E', 'Para o desenvolvimento deste projeto um questionário foi aplicado no início do segundo semestre de 2018 com os professores da Etec Cafelândia, onde identificou-se as dificuldades que eles encontravam ao agendar um laboratório por exemplo, dificuldade em e'),
(5, 'Aplicação de uma solução baseada em automação de gerenciamento da alimentação dos animais em confina', 'O projeto tem como objetivo conectar a tecnologia ao mundo rural, com a finalidade de facilitar o trabalhos dos funcionários e alunos; Economizar tempo e tornar mais eficiente o processo de alimentação dos animais em confinamento com uso da tecnologia.'),
(6, 'Desenvolvimento de uma ferramenta para gestão de vagas de estacionamento utilizando arduíno', 'Este projeto de TCC consiste em desenvolver um aplicativo que seja capaz de gerenciar vagas de estacionamento, de pontos turísticos e estabelecimentos cadastrados. Além disso, este possui comunicação com um dispositivo instalado em um determinada vaga que'),
(7, 'Desenvolvimento de uma plataforma de gerenciamento de recurso para automação residencial', 'O foco deste projeto consiste em uma criação de um sistema de gerenciamento de automação residencial a distância e proporcionar segurança ao cliente.'),
(8, 'Desenvolvimento de um sistema de controle de fluxo de entrada e saída de gados do curral', 'A proposta do TCC consiste em desenvolver um sistema capas de realizar a contagem de gado de um curral a partir do brinco de identificação, que controla o fluxo de entrada e saída dos animais.'),
(9, 'Contador de fluxo de passageiros', 'Sem descrição ');
